import React from 'react';
import './App.css';
import HeadTitle from './HeadTitle';
import Product from './Product';

function App() {
  return (
    <div >
      <HeadTitle></HeadTitle>
      <div className="container">
          <div className="row">
            <Product product_name = 'but chi' product_price = '5000'></Product>

          </div>
      </div>
    </div>
  );
}

export default App;
